import React, {Component} from 'react'



class Profil extends Component{
  
    render(){
      return(
        <div className='card mt-5 text-center' style={{width: '30%'}}>
          <div className='card-header'>
             <img src={this.props.name.imgSrc} alt='logo' style={{maxWidth: '100%'}}/>
          </div>
         <ul className='list-group'>
            <li className='list-group-item'>{this.props.fullName}</li>
            <li className='list-group-item'>{this.props.bio}</li>
            <li className='list-group-item'>{this.props.profession}</li>
         </ul>
         
        </div>
      )
      
    }
  }

export default Profil
